import React from "react";
import axios from "axios";

const Hook = (listItems) => {
  React.useEffect(() => {
    axios
      .get("https://dummyjson.com/products?limit=100")
      .then(function (response) {
        if (response?.data?.products) {
          listItems.current = response.data.products;
        }
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .finally(function () {
        // always executed
      });
  }, [listItems]);
};

export { Hook };
